import CustomTextInput from "@/app/component/ui/customTextInput";
import CustomNumberInput from "@/app/component/ui/customNumberInput";
import ImageInput from "@/app/component/ui/imageInput";
import { useEffect, useMemo } from "react";
import { useFormContext } from "react-hook-form";

export const CollegeDetailsForm = () => {
  const { setValue, watch } = useFormContext();
  const formData = useMemo(()=> ({
    email: "admin@jbgpgcollege.edu.in",
    collegeName: "J.B Girls P.G College",
    collegeAddress: "dev gav Road, Toonga",
    collegeCity: "Jaipur",
    collegeState: "Rajasthan",
    collegeZip: "303302",
    collegeCountry: "India",
    collegePhone: "+91 9876543210",
    collegeLogo: "data:image/png;base64,"
  }),[]);

  const handleAutoFill = () => {
    const formData = {
    email: "admin@jbgpgcollege.edu.in",
    collegeName: "J.B Girls P.G College",
    collegeAddress: "dev gav Road, Toonga",
    collegeCity: "Jaipur",
    collegeState: "Rajasthan",
    collegeZip: "303302",
    collegeCountry: "India",
    collegePhone: "+91 9876543210",
    collegeLogo: "data:image/png;base64,"
  };
  
    // Store values in localStorage to work with your existing CustomTextInput
    Object.entries(formData).forEach(([key, value]) => {
      localStorage.setItem(key, value);
    });

    // Force a re-render to show the new values
    window.location.reload();
  };

  // Auto-fill on component mount if fields are empty
  useEffect(() => {
    const currentValues = watch();

    // Check if college details are empty
    const isCollegeDetailsEmpty = !currentValues.collegeName &&
      !currentValues.collegeAddress &&
      !currentValues.email;

    if (isCollegeDetailsEmpty) {
      Object.entries(formData).forEach(([key, value]) => {
        setValue(key, value);
      });
    }
  }, [setValue, watch, formData]);

  return (
    <div className="pt-24">
      <div className="flex flex-row justify-between gap-3 mb-6">
        <p className="text-2xl font-semibold">College Details</p>
        <button
          onClick={handleAutoFill}
          className="w-fit text-sm px-4 py-1.5 bg-violet-500/10 text-violet-600 rounded-md hover:bg-violet-500/20 transition-colors font-medium"
        >
           Auto Fill Sample Data
        </button>
      </div>
      <CustomTextInput
        label="Email"
        placeholder="e.g. admin@jbgpgcollege.edu.in"
        variableName="email"
      />
      <p className="pb-10 pt-3 text-xs font-medium text-neutral-500">
        Please provide a valid email address for official communication and updates.
      </p>
      <p className="pb-2 text-sm font-medium text-neutral-500">College details</p>
      <CustomTextInput
        label="college name"
        placeholder="J.B Girls P.G College"
        variableName="collegeName"
      />
      <ImageInput label="Logo" variableName="collegeLogo" />
      <CustomTextInput
        label="Address"
        placeholder="Dev Gav Road, Toonga"
        variableName="collegeAddress"
      />
      <CustomTextInput
        label="City"
        placeholder="Jaipur"
        variableName="collegeCity"
      />
      <CustomTextInput
        label="State"
        placeholder="Rajasthan"
        variableName="collegeState"
      />
      <CustomNumberInput
        label="Zip"
        placeholder="303302"
        variableName="collegeZip"
      />
      <CustomTextInput
        label="Country"
        placeholder="India"
        variableName="collegeCountry"
      />
      <CustomTextInput
        label="Contact No."
        placeholder="+91 9876543210"
        variableName="collegePhone"
      />
    </div>
  );
};
